sys_hub_input_scripts.script:
{"arguments":{"scriptActive":true,"script":"var data = {}
data.upsert = {}
data.upsert.deviceId = parseInt(fd_data.subflow_inputs.armis_device_id)
data.upsert.name = fd_data.subflow_inputs.software_name
data.upsert.version = fd_data.subflow_inputs.software_version

//Format for Armis is : "2020-03-08T12:34:45"
//Format for GlideDateTime().toString() is "2020-03-08 12:34:45"
//Also subtract 10 minutes (10*60*1000 = 60000 milliseconds) because Armis doesn't like when you submit a time of exactly right now
var t = new GlideDateTime()
t.subtract(60000)
data.upsert.lastSeen = t.toString().replace(" ","T"); 

return JSON.stringify(data)"}}

